import mc from "./nav-bar-left.module.scss";
import { useState } from "react";

const NavBarLeft = () => {
  const [navHide, setNavHide] = useState(false);

  return (
    <div
      className={
        navHide
          ? `${mc.hideNavBar} ${mc.container}`
          : `${mc.container} ${mc.containerShow}`
      }
    >
      <div className={mc.rubrics_container}>
        <button className={mc.navBarState} onClick={() => setNavHide(!navHide)}>
          {navHide ? (
            <i class="icon-arrow-forward-outline"></i>
          ) : (
            <i className="icon-arrow-back-outline"></i>
          )}
        </button>
      </div>
    </div>
  );
};

export default NavBarLeft;
